import React from 'react';
import classes from 'Login.module.css';
const Login=()=>{
    return(
        <div className={classes.au}>
        <label>Email</label>
        <input type='email'/>
        <label>Password</label>
        <input type='number'/>
        <button>Submit</button>
        </div>
    )
}
export default Login;
